The positive predictive value (PPV) is calculated as  

\[
\text{PPV}= \frac{\text{TP}}{\text{TP}+\text{FP}}
          = \frac{0.90 \times 0.10}{0.90 \times 0.10 + 0.10 \times 0.90}
          = \frac{0.09}{0.09+0.09}
          = \frac{0.09}{0.18}
          = 0.50 \; (\text{or } 50\%).
\]

Rounded to the nearest whole percent, the PPV is **50%**, which corresponds to choice **B**.

